import React, { useState, useEffect } from 'react';
import axios from 'axios';

export default function TeacherRegister() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [message, setMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (message) {
      const timer = setTimeout(() => setMessage(''), 4000);
      return () => clearTimeout(timer);
    }
  }, [message]);

  const handleRegister = async (e) => {
    e.preventDefault();

    if (username.trim().length < 3) {
      setMessage('Kullanıcı adı en az 3 karakter olmalı.');
      setIsError(true);
      return;
    }
    if (password.trim().length < 6) {
      setMessage('Şifre en az 6 karakter olmalı.');
      setIsError(true);
      return;
    }

    setLoading(true);
    setMessage('');
    setIsError(false);

    try {
      const res = await axios.post('http://localhost:8080/api/auth/teacher/register', {
        username: username.trim(),
        password: password.trim(),
      });
      setMessage(res.data || 'Kayıt başarılı! Giriş yapabilirsiniz.');
      setIsError(false);
      setUsername('');
      setPassword('');
    } catch (err) {
      setMessage(err.response?.data?.message || 'Bir hata oluştu. Tekrar deneyin.');
      setIsError(true);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.page}>
      <div style={styles.container}>
        <h2 style={styles.title}>Öğretmen Kayıt</h2>
        <form onSubmit={handleRegister} style={styles.form} noValidate>
          <div style={styles.inputGroup}>
            <label htmlFor="username" style={styles.label}>Kullanıcı Adı:</label>
            <input
              id="username"
              type="text"
              value={username}
              onChange={e => setUsername(e.target.value)}
              style={styles.input}
              placeholder="Kullanıcı adınızı girin"
              disabled={loading}
              required
              minLength={3}
            />
          </div>
          <div style={styles.inputGroup}>
            <label htmlFor="password" style={styles.label}>Şifre:</label>
            <input
              id="password"
              type="password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              style={styles.input}
              placeholder="Şifrenizi girin"
              disabled={loading}
              required
              minLength={6}
            />
          </div>
          <button type="submit" disabled={loading} style={loading ? styles.buttonDisabled : styles.button}>
            {loading ? 'Kayıt oluyor...' : 'Kayıt Ol'}
          </button>
        </form>
        {message && (
          <p style={{ 
            ...styles.message, 
            color: isError ? '#ff6b6b' : '#4ade80' 
          }}>
            {message}
          </p>
        )}
      </div>
    </div>
  );
}

const styles = {
  page: {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #1e3c72, #2a5298)', // koyu mavi degrade arka plan
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  container: {
    backgroundColor: '#fff',
    padding: '40px 35px',
    borderRadius: 20,
    boxShadow: '0 15px 35px rgba(0,0,0,0.3)',
    width: '100%',
    maxWidth: 420,
  },
  title: {
    textAlign: 'center',
    marginBottom: 40,
    color: '#1e3c72',
    fontWeight: '700',
    fontSize: '2rem',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  },
  inputGroup: {
    marginBottom: 25,
  },
  label: {
    marginBottom: 8,
    display: 'block',
    fontWeight: '600',
    color: '#34495e',
    fontSize: '1rem',
  },
  input: {
    width: '100%',
    padding: '14px 18px',
    fontSize: '1rem',
    borderRadius: 12,
    border: '1.8px solid #bdc3c7',
    outline: 'none',
    transition: 'border-color 0.3s ease',
    boxSizing: 'border-box',
    fontWeight: '500',
    color: '#2c3e50',
  },
  inputFocus: {
    borderColor: '#1e3c72',
  },
  button: {
    padding: '15px',
    fontSize: '1.2rem',
    backgroundColor: '#1e3c72',
    color: 'white',
    fontWeight: '700',
    border: 'none',
    borderRadius: 16,
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  buttonDisabled: {
    padding: '15px',
    fontSize: '1.2rem',
    backgroundColor: '#6c7a89',
    color: 'white',
    fontWeight: '700',
    border: 'none',
    borderRadius: 16,
    cursor: 'not-allowed',
  },
  message: {
    marginTop: 25,
    fontWeight: '700',
    textAlign: 'center',
    fontSize: '1.1rem',
  },
};
